description:
[hcwin][DPM-3183][Customize resolution] Sync client settings to server by default.

New changes per our latest discussion:
1. Set the check-box of "Sync up with server" as checked by default;
   Previously it was not checked by default.
2. Don't update the UI with the DPI/resolution values from server after the check-box of "Sync up with server" is checked;
   Previously we will update the UI with them if the button is checked by user.

QA Notes: 
Testing Done: Yes, tested that:
1. The feature worked as expected per the above two changes;
2. Also tested the following scenarios and client worked fine:
   a. "Sync up with server" is checked, resolution is set as "Auto";
   a. "Sync up with server" is checked, resolution is set to some other values, such as "640X480", DPI is set as something like "150%";
   c. "Sync up with server" is unchecked, resolution is set as "Auto";
   d. "Sync up with server" is unchecked, resolution is set to some other values, such as "1280X800", DPI is set as something like "200%";
   e. Some other scenarios.
Sandbox:

[hcwin][DPM-3183][Customize resolution] Implemented sync up to server and launch desktop with specified resolution and scaling.

In this patch, the following things are done:
1. Sync the resolution between client and agent;
2. Store the user preference(resolution and scaling) to local prefs.txt;

Please refer to the testing part for more details.

